import React, {useState} from 'react'
import './Navbar.css'
import {Link} from 'react-router-dom'

function Navbar() {

  const [navToggle, setNavToggle] = useState(false);
  const handleNavToggle = () => setNavToggle(!navToggle);

  return (
    <nav className='navbar'>
      <Link to='/' className='navbar-logo col-3 col-d-2'>
        MICHELLE
      </Link>
      <div className='menuIcon' onClick={handleNavToggle}>
        <div className={navToggle ? 'hamburger col-5 col-d-1' : 'x col-2 col-d-1'} />
      </div>
    </nav>
  )
}

export default Navbar
